import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import "@styles/components/HomeContainer.css";
import ReactPlayer from "react-player";
import upload from "@assets/icons/upload.svg";
import arrowRight from "@assets/icons/arrow-right.svg"

const HomeContainer = () => {
  return (
    <>
      <div className="wrapper">
        <Container className="flex-row-center">
          <div className="flex-column-align-start">
            <Row>
                <Col lg={6} md={6} sm={12} xs={12} className="flex-row-center-align info">
              <img src={upload} alt="" className="me-3" />
              <div className='me-5'>
                <h2 className="title">Red Bull Racing</h2>
                <h6 className="hashtag">#drift#redbull#rbwings#rbenergy</h6>
              </div>
              <img src={arrowRight} alt="" />
              </Col>
            </Row>
            <ReactPlayer url="https://www.youtube.com/watch?v=ysz5S6PUM-U" />
            <Row className="flex-row-center-align">
                <Col lg={6} md={6} sm={6} xs={6}><img src={speaker} alt=""/></Col>
                <Col lg={6} md={6} sm={6} xs={6}>
                   <img src={share} alt=""/>
                   <img src={eye} alt=""/>
                   <img src={like} alt=""/>
                </Col>
            </Row>
          </div>
        </Container>
      </div>
    </>
  );
};

export default HomeContainer;
